   "source": [
    "**Fit a regression model on a suitable data set**\n",
    "\r\n",
    "When purchasing a house, it is a good idea to do in-depth research before making a final decision. Ther\r\n",
    "are some key factors that might affect the value of the property in question. Factors that may impact t e\r\n",
    "price of property in a particular area include the crime rate, access to highways, the size of the proper y,\r\n",
    "the features of the property, and so on. You have to be certain that the asking price of the property i  on\r\n",
    "par with that of similar properties within that particular area.\r\n",
    "In this assessment, you will use the Boston housing data set, fit a regression model, and calculate a\r\n",
    "prediction before purchasing a home.\r\n",
    "Description of  he data\r\n",
    "The Boston housing data set is derived from data collected in the 1970 census relating to the   rices of\r\n",
    "housing in Boston, Massachusetts. The target variable in is medv, representing the media  value of\r\n",
    "owner-occupied homes in thousands of Unfeld, 1978)"
   ]
  },
